import React from 'react';
import Data from '../data.json'
import { useParams } from "react-router-dom";

export default function Propiedad() {
    let { id } = useParams();
    return (
        <div className='propiedad'>
            {Data.map((post) =>
                <li key={post.id}>
                    {post.title}
                </li>
            )}
        </div>
    );
}
